import { Link } from '@phosphor-icons/react';
import React from 'react';

export default function Nav() {
    return (
        <div>
            <Link to="../index.html">Home</Link>
            <Link href="#">Shop</Link>
            <Link href="#">Featured</Link>
            <Link href="#">Recommended</Link>
        </div>
    )
}
